import React from "react";


const ToDoItem = ({toDo}) => {
	return(
		<tr>
		<td>{toDo.note}</td>
		<td>{toDo.note_text}</td>
		<td>{toDo.created}</td>
		<td>{toDo.status}</td>
		<td>{toDo.creator}</td>
		<td>{toDo.project}</td>
		</tr>
	)
}


const ToDoList = ({toDo_table}) => {
	return(
		<table style={{'margin': 'auto'}}>
		<th style={{'width': '25%'}}>Note</th>
		<th style={{'width': '25%'}}>Text</th>
		<th style={{'width': '25%'}}>Created</th>
		<th style={{'width': '25%'}}>Status</th>
		<th style={{'width': '25%'}}>Creator</th>
		<th style={{'width': '25%'}}>Project</th>
		{toDo_table.map((note) => <toDoItem toDo={toDo}/>)}
		</table>
	)
}


export default ToDoList;
